import React, {useState} from "react";
import SearchForProducts from "./SearchForProducts";
import MostPopularProducts from "./MostPopulerProducts";
import SearchResult from "./SearchForProducts";

function SideBar_ProductSearch() {

    const [search, setSearch] = useState('');

    const handleSearchChange = (e) => {
        setSearch(e.target.value);
    };

    return (
        <div className="sidenav">
            <div className="container">
                <label>Search:</label>
                <input type="text" placeholder="Search" name={"SearchBar"} value={search} onChange={handleSearchChange} required/>
                <SearchResult search={search}/>
            </div>

            <button>Services</button>
            <button>Clients</button>
            <button>Contact</button>
        </div>
    );
}

export default SideBar_ProductSearch;
